import React from "react";
import "../assets/styles/App.css";
import "../assets/styles/style_IkBenArts.css";
import Header from "../components/Header";

class IkBenArts extends React.Component {
  componentDidMount() {
    document.title = "Ik ben arts - Huur een arts";
  }

  loadImage(event) {
    var image = document.getElementById("output");
    var icon = document.getElementById("userIcon");
    image.src = URL.createObjectURL(event.target.files[0]);
    icon.parentNode.removeChild(userIcon);
  }

  render() {
    return (
      <div>
        <Header />

        <div className="heading_text">
          <span>Ik ben arts</span>
        </div>

        <div class="form_heading">
          <span>Persoonlijk</span>
        </div>

        <div class="form-check form-check-inline">
          <input
            class="form-check-input"
            type="radio"
            name="geslacht"
            id="vrouw"
            value="vrouw"
            required
          />
          <label class="form-check-label" for="geslacht">
            Vrouw
          </label>
        </div>
        <div class="form-check form-check-inline">
          <input
            class="form-check-input"
            type="radio"
            name="geslacht"
            id="man"
            value="man"
          />
          <label class="form-check-label" for="man">
            Man
          </label>
        </div>
      </div>
    );
  }
}

export default IkBenArts;
